about:
After five years of successful assignments in the coal industry in South Africa, XMP Consulting has achieved an extremely good rapport with large and small companies, based on a number of investigations to enhance marketability and profitability of client collieries.  With almost three decades of experience on coal data analysis, together with input from Associates, who have had an even longer direct involvement in the coal industry, we provide our clients with invaluable assistance in the development of new coal ventures.

The XMP coal team includes geologists, mining and coal processing engineers, logistics and marketing specialists, analysts and other support staff. 

XMP Consulting covers all South African producing coalfields and markets; 
Provides advice to the coal industry with a reputation for independence, quality and integrity; 
Has a depth of industry knowledge, which allows our experts to provide sound commercial advice; 
Integrates analysis with advice to allow better informed decision-making by clients; 
Applies a fundamentals-based methodology in coal, combined with a local and global view of supply and demand to identify the comparative advantage(s) in the market for each mine or coal deposit. 
Much of our work involves assignments awarded by our clients to analyze and develop solutions for specific problems or issues. For example, we conduct a significant amount of work for coal producers, transportation groups, coal consumers and others analyzing and forecasting: 

Transportation alternatives; 
Coal choices; 
Prices; 
Production capability; 
Competitive advantage.
